// // Add JavaScript code here
const onboarding = {};

onboarding.items = [
  {
    image:
      "data:image/png;base64,",

    heading: "Connect Multiple accounts",
    text: "Stay connected to any platform you are used to. Starting from Twitter, Instagram, Slack or whatever.",
    alt: "connect",
    order: 1,
  },
  {
    image:
      "data:image/png;base64,",
    heading: "Smart messaging system",
    text: "View your messages without leaving the video you currently watched.",
    alt: "message",
    order: 2,
  },
  {
    image:
      "data:image/png;base64,",
    heading: "Instant data analysis",
    text: "View and analyse all your activities group systematically for you to get conclusions",
    alt: "analysis",
    order: 3,
  },
];

onboarding.currentItem = 0;
onboarding.duration = 500;

onboarding.onSkip = () => {
  const nextEl = document.querySelector(".next");
  const skipEl = document.querySelector(".skip");

  nextEl.disabled = true;
  skipEl.disabled = true;
  const toastEl = document.querySelector(".toast");
  toastEl.setAttribute("data-state", "show");
  return;
};

onboarding.onNext = () => {
  const nextEl = document.querySelector(".next");
  const skipEl = document.querySelector(".skip");
  if (onboarding.currentItem >= onboarding.items.length - 1) {
    nextEl.disabled = true;
    skipEl.disabled = true;
    const toastEl = document.querySelector(".toast");
    toastEl.setAttribute("data-state", "show");
    return;
  }
  if (onboarding.currentItem === onboarding.items.length - 2) {
    const nextEl = document.querySelector(".next");
    nextEl.innerHTML = `Get Started&nbsp;&nbsp;<i class="fa-solid fa-arrow-right"></i>`;
  }
  onboarding.currentItem += 1;

  const paginationEls = document.querySelectorAll(".pagination__dot");
  let index = 0;
  paginationEls.forEach((dotEl) => {
    dotEl.removeAttribute("data-state");
    if (index === onboarding.currentItem)
      dotEl.setAttribute("data-state", "active");
    index += 1;
  });

  const itemEl = document.querySelector(".item");

  itemEl.setAttribute("data-animate", "start");
  itemEl.setAttribute("data-animate", "fadeOutIn");

  nextEl.disabled = true;
  skipEl.disabled = true;

  setTimeout(() => {
    const item = onboarding.items[onboarding.currentItem];
    const imgEl = document.querySelector(".item__header img");
    imgEl.src = item.image;
    imgEl.alt = item.alt;

    if (imgEl.getAttribute("data-size") !== null) {
      imgEl.removeAttribute("data-size");
    }

    if (item.alt === "directions") {
      imgEl.setAttribute("data-size", "small");
    }

    const headerEl = document.querySelector(".item__content h2");
    headerEl.innerText = item.heading;

    const textEl = document.querySelector(".item__content p");
    textEl.innerText = item.text;
  }, onboarding.duration / 2);

  setTimeout(() => {
    itemEl.setAttribute("data-animate", "complete");
    nextEl.disabled = false;
    skipEl.disabled = false;
  }, onboarding.duration);
};

onboarding.init = () => {
  const item = onboarding.items[0];
  const itemEl = document.querySelector(".item__header");

  const imgContainerEl = document.createElement("div");
  imgContainerEl.classList.add("item__image");

  const imgEl = document.createElement("img");
  imgEl.src = item.image;
  imgEl.alt = item.alt;

  const contentEl = document.querySelector(".item__content");
  const headerEl = document.createElement("h2");
  headerEl.innerHTML = item.heading;
  const textEl = document.createElement("p");
  textEl.innerHTML = item.text;

  imgContainerEl.appendChild(imgEl);
  itemEl.appendChild(imgContainerEl);
  contentEl.appendChild(headerEl);
  contentEl.appendChild(textEl);

  const paginationEl = document.querySelector(".pagination");
  onboarding.items.forEach(() => {
    const dotEl = document.createElement("div");
    dotEl.classList.add("pagination__dot");
    paginationEl.appendChild(dotEl);
  });
  const firstDotEl = document.querySelector(".pagination__dot");
  firstDotEl.setAttribute("data-state", "active");

  const nextEl = document.querySelector(".next");
  nextEl.addEventListener("click", (event) => onboarding.onNext(event));

  const skipEl = document.querySelector(".skip");
  skipEl.addEventListener("click", (event) => onboarding.onSkip(event));
};

onboarding.init();
